import { SET_DEPARTMENT, SET_CATEGORY, SET_SUB_CATEGORY } from '../types';

export const setDepartment = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_DEPARTMENT, payload });
    }
}

export const setCategory = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_CATEGORY, payload });
    }
}

export const setSubCategory = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_SUB_CATEGORY, payload });
    }
}
